import React from "react";
import { ICFacebook, Logofooter } from "../../../assets";
import "./footer.scss";

const Icon = ({ img }) => {
  return (
    <div>
      <img src={img} alt="icon" />
    </div>
  );
};

function Footer() {
  return (
    <div>
      <div>
        <div>
          <img className="logo" src={Logofooter} alt="logo" />
        </div>
        <div>
          <Icon img={ICFacebook} />
        </div>
      </div>
      <div>
        <p>Copyright</p>
      </div>
    </div>
  );
}

export default Footer;
